import styled from 'styled-components';
import { DropdownToggle } from 'reactstrap';

const Toggle = styled(DropdownToggle)`
  height: 12px;
  background: transparent;
  border: 0;
  margin-top: -14px;
  color: #3b3b3b;
  font-weight: 600;
  font-size: 14px;
`;

export default Toggle;
